“ 请问一下公司的npm私有源是哪位老师在维护？ ”
------
@刘从文  刘老师，我联系您

@所有人 因为疫情关系，食堂、物业也都人手不足，还请大家体量，辛苦大家每天按要求更新下用餐需求，一来数量冗余多也造成食堂人手更紧张，另一方面多了没人吃也非常地浪费。

所以每天发的第二天的用餐需求，大家根据当天的判断务必更新；第二天早上9点半前如果因为其他疫情情况调整了可以再更新当天的午餐晚餐情况。
咕咕表单全时段都开放更新。

@所有人?
驻宁员工明天的早中晚餐预定今天下午2点截止！
为避免食物浪费，现场办公情况一旦变动，可在截止时间前进行需求预订修改，请各中心团队内部相互提醒，感谢大家的配合。

@所有人 所有南京现场的同事，包括驻场外包注意通知：
请大家在15:05分前往3号楼1楼员工之家进行单管核酸检测，请戴好口罩做好防护、统一行动、间隔距离排队，做好后快速离开。
各楼层相互通知一下，现场检测时间不会很久。

